import HomePage from '../components/nav-bar/IndexNavbar';
import SignUpPage from '../components/login/signup/SignUpPage';

const routerIndex = [
    {
        path: '/',
        exact: false,
        components: HomePage,
    },
    {
        path: '/register',
        exact: true,
        components: SignUpPage,
    }
];

export default routerIndex;
